import React from 'react';

import Header from '../components/Header';

function HomePage() {
  return(
    <video autoplay loop muted>
      <source src="../public/MV.mp4" type="video/mp4" />
      Your browser does not support the video tag.
    </video>
  );
}

export default HomePage;
